import React, { Component } from 'react';
import Gallery from 'react-grid-gallery';
import Elder from '../Images/Elder.jpg';




class Designs extends Component {  

  renderImg = () => (
    <div className="imgs">
      <ul className="grid">
        <li>
          <figure className="grid_figure">
            <img src={Elder} alt={Elder}/>
          </figure>
        </li>
      </ul>
    </div>
  )

  render() {
    return (
      <div className="App">
      <h1>HI</h1>hello
      <div>
        {this.renderIMG}
      </div>
      </div>

    );
  }
}

export default Designs;
